import React from 'react';
import './FooterGeneral.css';
import {Navbar, Nav, Container, Button} from 'react-bootstrap';


const Header = () => {
    return (
  <Navbar className="color-nav" expand="lg">
    <Container class='navBar'>
      <Navbar.Brand href="/catalogo">
        <img src={require('./src/DomusLogo.png')} alt='logo' class='logo'/>
     </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Nav className="me-auto">
        <Nav.Link href="/catalogo">Inicio</Nav.Link>
        <Nav.Link href="/administrarpropiedades">Propiedades</Nav.Link>
        <Nav.Link href="/quienessomos">Quienes somos</Nav.Link>
        <Nav.Link href="/secretariaDC">Cambiar vista</Nav.Link>
        <Button className="position-absolute top-1 end-0" href="/iniciarsesion">Iniciar Sesion</Button>
      </Nav>
      </Container>
  </Navbar>
  );
}

export default FooterGeneral;
